import React from "react";
import Header from "../../section/header";
import { useStyles } from "./style";



const Login = (props)=>{

  const s = useStyles()

  return(
    <div>
      <Header/>
      <div className={s.login}>
      <form className="form">
          <FormControl>

          </FormControl>

          <Button type="button" color="primary" className="form__custom-button">
            Log in
          </Button>
        </form>
      </div>
    </div>
  )
}

export default Login
